import React from "react";
import AppLayout from "../components/AppLayout";
import Head from "next/head";
import { Form, Input, Button } from "antd";
import { useState, useCallback } from "react";
const Signup = () => {
  const [id, setId] = useState();
  const [password, setPassword] = useState();
  const [passwordCheck, setPasswordCheck] = useState();

  const onChangeId = useCallback((e) => {
    setId(e.target.value);
  }, []);

  const onChangePassword = useCallback((e) => {
    setPassword(e.target.value);
  }, []);

  const onChangePasswordCheck = useCallback((e) => {
    setPasswordCheck(e.target.value);
  }, []);

  const onSubmitSignup = useCallback(() => {
    console.log(id, password);
    alert("회원가입이 완료되었습니다");
  }, [id, password]);

  return (
    <AppLayout>
      <Head>
        <title>회원가입</title>
      </Head>
      <Form onFinish={onSubmitSignup}>
        <div>
          <label value={id} onChange={onChangeId}>
            아이디
          </label>
          <br />
          <Input />
        </div>
        <div>
          <label type="password" value={password} onChange={onChangePassword}>
            비민번호
          </label>
          <br />
          <Input />
        </div>
        <div>
          <label  value={passwordCheck} onChange={onChangePasswordCheck}>
            비민번호 체크
          </label>
          <br />
          <Input />
        </div>
        <Button type="primary">회원가입</Button>
      </Form>
    </AppLayout>
  );
};

export default Signup;
